    false,nt"url": null,nt"notes": "This project examines the factors influencing
    fish populations including habitat, harvest, hatcheries, hydropower system operations,
    and climate change. It seeks to estimate impacts of these factors on Wenatchee River
    basin spring Chinook salmon through the use of the Shiraz life cycle model parameterized
    for this fish population. An evaluation of a suite of habitat restoration actions
    will be conducted, a reparameterized model to incorporate supplementation effects
    will estimate the impacts on wild fish from hatchery operations, and the influence
    of climate change as estimated from several bracketing Global Climate Models (and
    their basin impacts determined via DHSVM modeling) will be examined. The Shiraz
    and climate modeling work is led by Dr. Jon Honea at Emerson College (Boston, MA),
    an external collaborator who began this work in a post-doctoral position at the
    NWFSC. And, we are using life cycle modeling in an evaluation of benefit/cost of
    suites of freshwater habitat actions.nnModel.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
